import React, { useContext, useState } from "react";
import Login from "./component/login";
import { BrowserRouter, Route, Link, Routes } from "react-router-dom";
import Admin from "./component/admin";
import User from "./component/user";
import Signup from "./component/signup";
import Landing from "./component/landing";
import Card from "./component/card";
import AdminLogin from "./component/adminlogin";
import AdminSignup from "./component/adminsignup";
import formContext from "./context/form/formcontext";



function App() {

  const a = useContext(formContext)

  const [num, inc] = useState(0);

  console.log('nav')



  return (
    <BrowserRouter>

      <nav style={{padding:' 1rem 10%',display:'flex',justifyContent:'flex-end',background:'white'}} >



        <div style={{padding:'3vw 0',display:'flex',justifyContent:'space-between'}}>{localStorage.getItem('auth-token') &&
          <button style={{background:'white',color:'royalblue',borderRadius:'2rem',fontSize:'1rem',marginRight:'2rem'}} onClick={() => { localStorage.removeItem('auth-token'); inc(prev => prev + 1) }} className="  btn btn-primary">Logout</button>}
        {localStorage.getItem('auth-token-admin') &&
          <button style={{background:'white',fontSize:'1rem',color:'royalblue',borderRadius:'2rem'}} onClick={() => { localStorage.removeItem('auth-token-admin'); inc(prev => prev + 1) }} className=" btn btn-primary">Admin Logout</button>}
        {!localStorage.getItem('auth-token') &&
          <Link to={'/signup'} className=" ms-5 btn btn-primary">User Login/Signup</Link>}</div>

      </nav>

      <Routes>
        <Route path="/" element={< Landing />} />
        <Route path="/login" element={<Login />} />

        <Route path="admin" element={<Admin />} />

        <Route path="user" element={<User />} />

        <Route path="signup" element={<Signup />} />

        <Route path="adminsignup" element={<AdminSignup />} />

        <Route path="card" element={<Card />} />

        <Route path="adminlogin" element={<AdminLogin />} />
      </Routes>
    </BrowserRouter>
  )
}

export default App;
